import s1 from "./s1.jpg";
import s2 from "./s2.jpg";
import s3 from "./s3.jpg";

function Img(props) {
    return (
        <div className="slide">
            <img src={props.id} alt="s1" />
            <div className="info">
                <h1>{props.title}</h1>
                <p>{props.par}</p>
            </div>
        </div>

    );

}

export default Img;
